    println(firstUniqueChar("leetcode"))
    println(firstUniqueChar("aabbccddeel"))
    println(firstUniqueChar("loveleetcode"))
    println(firstUniqueChar("aabb"))
    println(
        firstUniqueChar(
            ""
        )
    )
    println(
        firstUniqueChar(
            ""
        )
    )
}

private val map = mutableMapOf<Char, Int>()

private fun firstUniqueChar(s: String): Int {

    val size = s.length
    for (index in 0 ..< size) {
        val subString = if (index == size - 1) {
            s.substring(0, index)
        } else {
            s.substring(0, index) + s.substring(index + 1)
        }

        if (!subString.contains(s[index])) {
            return index
        }
    }

    return -1
}

private fun firstUniqueChar(s: String, index: Int) : Int {

    if (s.length == index) {
        return -1
    }

    val currentChar = s[index]
    val subString = s.substring(0, index) + s.substring(index + 1)

    /*if (subString.isEmpty()) {
        return -1
    }*/

    var count = 0
    val charArray = subString.toCharArray()
    loop@for (element in charArray) {
        if (currentChar == element) {
            ++count
            break@loop
        }
    }

    if (count == 0) return index

    return firstUniqueChar(s, index + 1)

}